import axios from 'axios';

console.log("entry"); 
async function fetchData(){
    // access data directly in json format not in promise
    const userDataJson= await axios.get("https://randomuser.me/api/");  
    console.log(userDataJson.data.results[0]);
}
fetchData(); 

export default fetchData;
